import React from 'react';
import { Route, BrowserRouter,Routes} from 'react-router-dom';
import './brand.css';

import routes from './components/pages/index';

// Import Home02 components
import Header from './components/layouts/home02/Header';
import Home02 from './components/pages/Home02';
import Footer from './components/layouts/home02/Footer';

function App() {

  return (
      <BrowserRouter>
          <Routes>

            {
                routes.map((route, idx) => (
                    <Route exact path={route.path} element={route.component} key={idx} ></Route>

                ))

              }

           </Routes>

      </BrowserRouter>
  );
}

export default App;
